        <div className="signup">
            <div className="container mt-5">
                <div className="signup-content">
                    <div className="signup-form">
                        <h2 className="form-title">SignUp!</h2>
                        <form className="form-group">
                            
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Signup;
